import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import StudentView from './components/StudentView';
import EditStudentContainer from './components/containers/EditStudentContainer';

function App() {
  return (
    <Router>
      <Switch>
        {/* Route for viewing student details */}
        <Route path="/student/:id" component={StudentView} />

        {/* Route for editing student details */}
        <Route path="/editstudent/:id" component={EditStudentContainer} />
      </Switch>
    </Router>
  );
}

export default App;
